import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import Spinner from '../../components/Spinner.jsx';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import Footer from '../../components/Footer';
import MenuAdmin from '../../components/MenuAdmin';

const ModifyMissionForm = ({ missionId }) => {
    const [loading, setLoading] = useState(true);
    const [missionDetails, setMissionDetails] = useState({
      title: '',
      description: '',
      assignedTo: '',
      startDate: '',
      endDate: '',
    });
  
    useEffect(() => {
      const authToken = localStorage.getItem('authToken');
  
      const fetchMissionDetails = async () => {
        try {
          const response = await fetch(`http://localhost:5000/api/admin/mission/${missionId}`, {
            method: 'GET',
            headers: {
              Accept: 'application/json',
              'Content-Type': 'application/json',
              Authorization: `Bearer ${authToken}`,
            },
          });
  
          if (response.ok) {
            const missionData = await response.json();
            setMissionDetails(missionData);
            setLoading(false);
          } else {
            console.error('Error fetching mission details:', response.statusText);
            setLoading(false);
          }
        } catch (error) {
          console.error('Error fetching mission details:', error.message);
          setLoading(false);
        }
      };
  
      fetchMissionDetails();
    }, [missionId]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setMissionDetails({ ...missionDetails, [name]: value });
  };

  const handleSaveChanges = async () => {
    try {
      const authToken = localStorage.getItem('authToken');
      const response = await fetch(`http://localhost:5000/api/admin/update-mission/${missionId}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${authToken}`,
        },
        body: JSON.stringify(missionDetails),
      });

      if (!response.ok) {
        throw new Error('Error updating mission details');
      }

      toast.success('Mission details updated successfully!');
      // Redirect or show a success message
    } catch (error) {
      toast.error('Error updating mission details:', error.message);
      // Show an error message to the user
    }
  };

  return (
    <>
      <MenuAdmin />

      <div className="main-container">
        <h1>Modify Mission</h1>
        {loading ? (
          <Spinner />
        ) : (
          <div className="modify-mission-form">
            <form>
              <div className="form-flex">
                <label>Title:</label>
                <input
                  type="text"
                  name="title"
                  value={missionDetails.title}
                  onChange={handleInputChange}
                />
              </div>
              <div className="form-flex">
                <label>Description:</label>
                <textarea
                  name="description"
                  value={missionDetails.description}
                  onChange={handleInputChange}
                />
              </div>
              <div className="form-flex">
                <label>Start Date:</label>
                <input
                  type="date"
                  name="startDate"
                  value={missionDetails.startDate}
                  onChange={handleInputChange}
                />
              </div>
              <div className="form-flex">
                <label>End Date:</label>
                <input
                  type="date"
                  name="endDate"
                  value={missionDetails.endDate}
                  onChange={handleInputChange}
                />
              </div>
              <div className="form-flex">
                <label>Assigned To:</label>
                <input
                  type="text"
                  name="assignedTo"
                  value={missionDetails.assignedTo}
                  onChange={handleInputChange}
                />
              </div>
              <button type="button" onClick={handleSaveChanges}>
                Save Changes
              </button>
            </form>
          </div>
         )}
         </div>
         <ToastContainer />
         <Footer />
       </>
     );
   };

export default ModifyMissionForm;
